import { BrowserRouter,  Routes, Route, } from "react-router-dom";
import './PlayOptions.css'
import Hamburger from './Hamburger'

function PlayOptions() {
    return (

        <BrowserRouter className="PlayOptions">
            <Routes>
                <Route className='PlayOption' path="/" element={<Hamburger />}>flip</Route>
                <Route className='PlayOption' path="expenses" element={<Hamburger />}>create private room</Route>
                <Route className='PlayOption' path="invoices" element={<Hamburger />}>join private room</Route>
            </Routes>
    </BrowserRouter>
    );
};

export default PlayOptions;
